import Form from 'react-bootstrap/Form';
import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import classes from './form.module.css';
import { Formik } from 'formik';
import {  Field, ErrorMessage } from 'formik';
export const BasicFormik = () => (
<div>
     <h1>Find your </h1>
     <Formik
       initialValues={{ cars: '' }}
       
       onSubmit={(values)  => {
        console.log("submitted!")
         }
       }
     >
       {({
         values,
         errors,
         touched,
         handleChange,
         handleBlur,
         handleSubmit,
         isSubmitting,
         /* and other goodies */
       }) => (
         <form onSubmit={handleSubmit}>
       <FormAdvertisement />
         </form>
       )}
     </Formik>
   </div>
 );
  
  


  export const FormAdvertisement=()=> {
    return (
      <div className={classes.gridcontainerelement}>
      <div className={classes.gridchildelement }>
      <Form.Label>Type of vehicle</Form.Label>
        <Form.Select size="lg">
          <option>Cars</option>
          </Form.Select>
          <Form.Label>Brand</Form.Label>
          <Form.Select size="lg">
          <option>BMW</option>
          </Form.Select>
          <Form.Label>model</Form.Label>
          <Form.Select size="lg">
          <option>X5</option>
          </Form.Select>
          <Form.Check
            inline
            label="Verified VIN"
            name="group1"
          />          </div>
<div className={classes.childForm}>
<Form.Label>Region</Form.Label>
        <Form.Select size="lg">
          <option>Kyiv</option>
          </Form.Select>
          <Form.Label>Year</Form.Label>
          <Form.Select size="lg">
          <option>1990</option>
          </Form.Select>
          <Form.Select size="lg">
          <option>2090</option>
          </Form.Select>
          <Form.Label>Price $</Form.Label>
          <Form.Select size="lg">
          <option>1</option>
          </Form.Select>
          <Form.Select size="lg">
          <option>100000</option>
          </Form.Select>
</div>

      </div>
    );
  };
